import React from "react";
import "./home.css";

const ProfileCards = () => {
  const slides = [
    { image: "/images/slider1.jpg" },
    { image: "/images/slider2.jpg" },
    { image: "/images/slider3.jpg" }
  ];

  return (
    <div className="main-container">
      {/* Text container on the left */}
      <div className="container_h2">
        <h2>JOYO New Energy</h2>
        <p>Guangdong Aofei New Energy Co., Ltd. was established in Guangzhou, China in 2021. As a wholly-owned subsidiary of Aofei Data, a company listed on the A-share market (stock code: 300738), Aofei New Energy focuses on the distributed photovoltaic market in China. The company is dedicated to the investment development, construction management, technological research and development, and operational services of distributed photovoltaic projects. To date, we have constructed power stations in more than ten provinces across China, rapidly emerging as a leader in the industrial and commercial photovoltaic sector.

With a global perspective, Aofei New Energy launched its international operations from Singapore in 2023, making a full-scale entry into overseas markets to serve both individual and industrial clients. Leveraging a strong R&D team and cutting-edge technology concepts, we collaborate with top industry players to provide customers with comprehensive, one-stop green energy solutions throughout the entire lifecycle, from demand analysis and design planning to construction implementation and subsequent operations.</p>
      </div>

      {/* Image cards container on the right */}
      <div className="container_h1">
        {slides.map((slide, index) => (
          <div
            key={index}
            className={`profile-card card-${index + 1}`}
            style={{
              backgroundImage: `url(${slide.image})`,
              backgroundRepeat: "no-repeat",
              backgroundPosition: "center",
              backgroundSize: "cover"
            }}
          >
            <div className="content">
              <span>Card {index + 1}</span>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default ProfileCards;
